INSERT INTO `category` (`id`, `cat`, `slung`, `image`, `description`, `col`, `created_at`, `updated_at`) VALUES
(1, 'Printers & Photocopiers', 'printers-photocopiers', '1102H93EU0_2.jpg', 'There are two types of Car radio stereos&nbsp;depending on size.\r\n\r\n<br><br><b>Single Din Radio</b> - The most common size for a car stereo is\r\na single DIN. These stereos are approximately 7″W x 2″H in size and will fit in\r\njust about every vehicle. Under this Category we have Car radio with FM, CD\r\nplayer, USB &amp; AUX, and Car Stereo with DVD player or Radio with DVD player,\r\nUSB, AUX input &amp; Bluetooth.<br><br>&nbsp;Car Radio with retractable screen falls under the single din\r\ncategory.&nbsp;<a href=\"https://www.amanivehiclesounds.co.ke/product/PIONEER%20AVH-Z7250BT%20pioneer%20Car%20radio%20system%20with%20Android%20Auto\" target=\"\" rel=\"\">https://www.amanivehiclesounds.co.ke/product/PIONEER%20AVH-Z7250BT%20pioneer%20Car%20radio%20system%20with%20Android%20Auto</a><br><br><b>Double Din Radio </b>– A Double din car stereo is approximately\r\ntwice the height of a single din car stereo, it measures in at about 7″W x 4″H.\r\nCommon features include 6.2” to 7 “ Touch screen display, Reverse camera input,\r\nBluetooth, DVD, USB port, Spotify web link, android auto, apple car play &amp;\r\nNavigation depending on each radio. Car Stereo with Navigation tend to be\r\npopular as you can drive anywhere with the help of maps for direction.', '1', '2019-04-30 15:52:40', '2019-04-30 15:52:40'),
(2, 'Laptops', 'laptops', 'Dell-XPS-9370-Laptop.jpg', '<div>There are different types of <b>car speaker’s</b>/ <b>mid-range</b>\r\nspeakers based on their cone size &amp; shape, place of install. The most\r\ncommon types of speakers are; <br></div><div>\r\na)\r\n4-inch speaker commonly known as dashboard\r\nspeakers <br></div><div>\r\nb) 6.5 inch speakers commonly known as round/ door\r\nspeakers.</div><div>\r\n\r\nc) 6 by 9 inch speakers commonly known as oval\r\nspeakers. <br></div><div>\r\nd) 7 by 10-inch car speakers.\r\n\r\n<br></div><div>e)10-inch car speakers. <br></div><div><br></div><div>\r\nCar speakers are an essential part a cars entertainment,\r\n&amp; are normally the first step to a car audio system upgrade.<br></div><div><br></div><div>\r\n\r\nShop for <b>Kenwood</b>, <b>Sony</b>, <b>JVC </b>&amp; <b>Pioneer</b> speakers all in\r\none place.\r\n\r\n</div><br><br><br><br>', '1', '2019-04-30 17:32:57', '2019-04-30 17:32:57'),
(3, 'Desktops', 'desktops', '43.2.jpg', '<div>Car Tweeter speakers may be the only component missing to complete your car audio setup. Tweeters purpose is to produce high audio frequencies.For speakers,tweeters make it seem like the sound is surrounded by a stage.</div><div><br></div><div>The most common types of car tweeters are Dome Tweeters &amp; Bullet tweeters with their difference in performance being realized in dispersion control &amp; efficiency.</div><div><br></div><div>Bullet tweeters have relatively a higher power output compared to dome tweeters.</div><div>For Personal Vehicles, tweeters are mostly mounted on either side of the dashboard close to the doors.</div><div><br></div><div>Shop for car tweeters by your favorite brand; Pioneer, Ken-wood &amp; Sony from the link below<br></div><div><a href=\"https://www.amanivehiclesounds.co.ke/products/cat/CAR%20TWEETERS\" target=\"\" rel=\"\">https://www.amanivehiclesounds.co.ke/products/cat/CAR%20TWEETERS</a><br></div><br>', '1', '2019-05-01 04:49:41', '2019-05-01 04:49:41'),
(4, 'Smartphones', 'smartphones', '2.jpg', '<div>A car Sub woofer is a vital product (for music lovers) in any\r\ncar music system. Installing a sub woofer speaker in your car improves the\r\nquality of the sound produced in a significant way.<br></div><div><br></div><div>\r\n\r\nCar Sub woofers are designed to produce low frequency sounds\r\nmaking any kind of music genre sound better. When choosing a Sub woofer for your\r\ncar sound system, there are a number of things to consider; Speaker size (depending\r\non your boot space), Enclosure type (sealed or ported). <br></div><div><br></div><div>\r\nBass Speakers, as they are commonly known are of Different\r\ntypes;</div><div><br>\r\n\r\n</div><ul><li>&nbsp;\r\n\r\n<span><b>Standard\r\nSub woofer Speakers</b> -These sub&nbsp;woofers come individually without being fitted\r\nin any type of enclosure in order to fit in every car. You can customize a\r\nspeaker cabinet for the sub woofer to your liking.</span>\r\n\r\n<a href=\"https://www.amanivehiclesounds.co.ke/products/cat/CABINETS\" target=\"\" rel=\"\">https://www.amanivehiclesounds.co.ke/products/cat/CABINETS</a>\r\n\r\n&nbsp; <br></li></ul><br><ul><li><span><b>Bass Tube\r\nSpeakers</b> - A Bass Tube is a type of sub woofer where the speakers are\r\nenclosed in a tube.</span></li></ul><br>&nbsp;<a href=\"https://www.amanivehiclesounds.co.ke/product/JBL%20CS1204T%20BASS%20TUBE%20SUBWOOFER\" target=\"\" rel=\"\">https://www.amanivehiclesounds.co.ke/product/JBL%20CS1204T%20BASS%20TUBE%20SUBWOOFER</a>&nbsp;\r\n\r\n<br><br><div><ul><li>&nbsp;<span><b>Powered\r\nSub woofers </b>– Also known as self-amplified sub woofers or Active sub woofers. This\r\nis a type of sub woofers that are built into an enclosure which is powered by an\r\namplifier.</span> These sub woofers are also great for a fast and\r\neasy upgrade and they allow you to save the maximum amount of space in your\r\nvehicle. They allow the user to add bass while conserving space. Under this\r\ncategory are Underseat sub woofers that are specially designed to fit below a\r\ncar seat.\r\n\r\n&nbsp; </li></ul><br><br></div><div><br></div>', '1', '2019-05-01 05:55:37', '2019-05-01 05:55:37'),
(5, 'Smartphone Accessories', 'smartphone-accessories', '4.jpg', '<div>A car Amplifier is the component that gives your music power\r\nand Volume.\r\n\r\n<span><b>Amplifiers</b> take a signal from the stereo and use an\r\nindependent power source to change it into a more powerful signal for the\r\nspeakers. The more power the amplifier delivers, the cleaner the sound from the\r\nspeakers. </span>\r\n\r\n<br></div><div><br></div><div>Depending on the number of channels amplifier categories\r\nare; Mono block, 2 channel,4 channel, 5 channel Amplifiers.\r\n\r\n</div><br><br><br><br>', '1', '2019-05-01 06:05:52', '2019-05-01 06:05:52'),
(6, 'TVs', 'tvs', '6.jpg', '<div>There are many types of car video monitors in the market today.\r\nCar Monitors come in different shapes and sizes. The most Common types are as\r\nfollows;</div><div><br></div><ul><li> \r\n\r\n<span><b>Headrest\r\nCar Video Monitors</b> – They come in different sizes, colors &amp; features.\r\nHeadrest Monitors are universal to all cars &amp; are installed by either\r\nreplacing the car headrest or by hanging (depending on type). Headrest monitors\r\nare sold in pairs.</span>\r\n\r\n·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li></ul><br><ul><li><span><b>Flip Down\r\nCar Video Monitors / Roof Mount</b> -&nbsp;\r\nRoof Mount monitors come in different sizes &nbsp;&nbsp;11” 14”, 15”, 17”.</span>\r\n\r\n·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</li></ul><br><ul><li><span>\r\n<b>Dashboard\r\nMonitors</b> – Normally looks like the computers normal monitor &amp; it stands\r\nalone on the cars Dashboard. Dashboard Monitors come in different sizes.</span>\r\n\r\n<span>·&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br></span></li><li><span>\r\n<b>Rear View\r\nCar Video Monitors </b>– Rear View Monitors come with straps to mount on the\r\nexisting car rear view mirror. You can use them to play Videos, listen to the\r\nradio or as a reverse camera display.</span>\r\n\r\n</li></ul><br><br><br>', '2', '2019-05-01 06:17:28', '2019-05-01 06:17:28'),
(7, 'Music Systems', 'music-systems', '1.jpg', '<div>Shop for the Best Car Accessories at the best price in Kenya. Choose from a wide range of supplementary Components such as Jump stater, Smartphone holders FM expanders and many more.<br><br>Our Car Accessory products are suitable for all car types.</div><br><br><br><br>', '2', '2019-05-03 08:42:53', '2019-05-03 08:42:53'),
