INSERT INTO `privacy` (`id`, `title`, `content`, `created_at`, `updated_at`) VALUES
(1, 'General Information', 'Accessories Kenya Limited values the privacy of any person or organization, business in nature, or otherwise. We are therefore committed to protecting any personal information collected through the accessories.co.ke website Accessories Kenya Limited may from time to time change this information and will inform all interested parties of the changes.<br><br>', '2019-05-04 02:33:34', '2019-05-04 02:33:34'),
(2, 'Policies', '<h2><i>Personal Information Collected</i> \r\n</h2>accessories.co.ke will gather information in the background when any person or legal entity visits the&nbsp; accessories.co.ke website using cookies. This may include IP address, device type, Internet browser type, operating system, location, and other device-specific information. Data collected is for business intelligence meant for enhancing user experience any time a user visits the accessories.co.ke.<br><br>\r\n\r\n<h2>&nbsp;<i>Management of personal database</i></h2>\r\n\r\n<span> You can choose whether you wish to receive promotional communications from our website by email using the subscribe form in the footer section of this page. If you receive promotional email or SMS messages from us and would like to opt-out, you can request the deletion of your email through <a href=\"mailto:info@accessories.co.ke\" rel=\"\">info@accessories.co.ke</a>. </span> <br><br>\r\n\r\n<h2><i>Contact</i></h2>&nbsp;You have the right to review the personal data we keep about you. You can request an overview of your personal data by emailing&nbsp;info@accessories.co.ke with the subject line Request for personal information. To help us prevent the fraudulent collection of personal information, please include a scan of your passport or identity card. If you would like us to remove your personal information from our database, please email&nbsp;info@accessories.co.ke with the subject line Request for the removal of personal information. Please bear in mind that we may need to retain certain information for legal and/or administrative purposes such as record keeping or to detect fraudulent or criminal activities. <br><br>', NULL, NULL);
