(6, 'Kyocera Ecosys P2035', 'kyocera-ecosys-p2035', NULL, 0, 'In Stock', 'Kyocera Ecosys P2035', '9500', 500, '1', NULL, 0, 0, 0, 0, 3, 'Ex-UK', 'Kyocera Ecosys P2035', 'Others', '0', 'The ECOSYS P2035 is a cost effective, reliable black &amp; white printing solution for small workgroups and individual users requiring a desktop printer that can meet the heavy output demands of their business.<span>With speeds up to 37 pages per minute, it delivers exceptionally crisp output quality from first page to last.<br><br><div>37 ppm B&amp;W</div><div>Print</div><div>600 x 600 dpi, Up To Fine 1200 dpi</div><div>Standard: 300 Sheets</div><div>Maximum: 550 Sheets</div></span>', 'Kyocera-Ecosys-P2035-001.jpg', NULL, 'Kyocera-Ecosys-P2035-002.jpg', NULL, NULL, '2020-10-08 05:21:39', '2020-10-08 05:21:39'),
