Single SIM models availableSIM card type&nbsp;Nano SIMSensors&nbsp;Ambient light sensor, Proximity sensor, Accelerometer (G-sensor)Keys&nbsp;The Google Assistant Button4<br><br><b>Cameras<br></b>Rear cameras&nbsp;5 MP f/2.2 auto focusRear flash&nbsp;LEDFront-facing camera&nbsp;5 MP<br><br><b>Battery<br></b>Battery type&nbsp;Removable 2800 mAh2Charging&nbsp;5V/1A compatible<br><br><b>Storage<br></b>Internal storage&nbsp;16 GBMicroSD card slot&nbsp;Support for up to 64 GB<br><br><b>Display<br></b>Size&nbsp;5.7”Type&nbsp;HD+ IPSDisplay ratio&nbsp;18:9Audio3.5 mm headphone jackFM radio receiver (headset required)1 microphone<br><br><b>Network and connectivity<br></b>Network bands (Africa, Middle East, Asia Pacific)&nbsp;GSM: 850, 900, 1800, 1900 - WCDMA: 1, 5, 8 - LTE: 1, 3, 5, 7, 8, 20, 28, 38, 40, 41Network speed&nbsp;LTE Cat 4WiFi&nbsp;802.11 b/g/nBluetooth® 4.2GPS/AGPS<br>', 'nokia-c2-57-android-9-pie-1gb-16gb-dual-sim001.jpg', NULL, 'nokia-c2-57-android-9-pie-1gb-16gb-dual-sim-002.jpg', 'nokia-c2-57-android-9-pie-1gb-16gb-dual-sim-003.jpg', NULL, '2020-10-14 15:31:34', '2020-10-14 15:31:34'),
(20, 'Samsung Galaxy A10S 6.2\" 4000 MAh - 32GB + 2GB- Dual Sim, 4G', 'samsung-galaxy-a10s-62-4000-mah-32gb-2gb-dual-sim-4g', NULL, 0, 'In Stock', 'Samsung Galaxy A10S 6.2-inch 4000 MAh battery - 32GB Storage  2GBRAM- Dual Sim, 4G', '13300', 500, '4', NULL, 0, 0, 0, 0, 3, 'New', 'SamsungGalaxyA10S', 'Samsung', '0', 'Samsung Galaxy A10s is the newest addition to the Galaxy A family, it delivers powerful performance and optimized functionality primed for a new era of communication and connectivity. Thanks to its 4,000mAh battery, the Galaxy A10s can keep up with you all day, whether you are gaming, streaming, or broadcasting live. The all-new dual camera means brighter, clearer photos, while depth detection intelligently recognizes backgrounds and allows you to add artistic effect to your images. The Galaxy A10s remarkable 6.2-inch Infinity-V Display provides an immersive experience when catching up on your favorite content, and with the addition of a fingerprint scanner to the Galaxy A10s, you can be sure to keep your data safe.&nbsp;<br><br><b>Display, Battery and Connectivity</b><br>The Samsung Galaxy A10s flaunts a 6.2-inch TFT display with a screen resolution of 720 x 1,520 pixels. It results in a quality screen resolution of 271 PPI. The device gets its required power from a 4,000mAh Li-ion battery. It has a wide range of networking and sharing options too including Wi-Fi, GPS, MicroUSB, Bluetooth, 4G with VoLTE, Bluetooth, etc.<br><br><b>Camera and Storage</b>The Samsung Galaxy A10s is armed with a 13MP + 2MP primary camera, which can capture quality images and also can record videos. There is an 8MP lens at the front that helps to click selfies and assists with video calls. The smartphone is equipped with a 32GB inbuilt storage, which can be further expanded up to 512GB by using a memory card.<br><br><b>Samsung Galaxy A10s Performance</b>The Samsung Galaxy A10s comes with a 2GHz octa-core processor that deals with the overall performance of the system. It is paired with a 2GB RAM and 32GB internal storage to give you a smooth experience.', '001.jpg', NULL, '-002.jpg', '-003.jpg', NULL, '2020-10-14 15:39:03', '2020-10-14 15:39:03'),
(21, 'Samsung Galaxy A11, 6.4\", 32GB + 2GB RAM (Dual SIM), 4000mAh', 'samsung-galaxy-a11-64-32gb-2gb-ram-dual-sim-4000mah', NULL, 0, 'In Stock', 'Samsung Galaxy A11, \r\n64-Inches Screen,\r\n32GB Storage,\r\n2GB Ram,\r\nBattery Capacity 4000mAh', '13700', 500, '4', NULL, 0, 0, 0, 0, 3, 'New', 'GAL-A11SM', 'Samsung', '0', 'Samsung Galaxy A11 smartphone&nbsp;comes with a 6.40-inch touchscreen display with a resolution of 720x1560 pixels. Samsung Galaxy A11 is powered by a 1.8GHz octa-core processor. It comes with&nbsp;2GB of RAM&nbsp;and packs&nbsp;32GB of inbuilt storage. The Samsung Galaxy A11 runs Android and is powered by a&nbsp;4000mAh&nbsp;battery.&nbsp;<br><br><h2><b>A big screen for a better view</b></h2><span>Immerse yourself in the large 6.4 inch Infinity-O Display of Galaxy A11. A wide aspect ratio fills your screen with content from edge to edge. Watch your favorite videos, games and live streams in vivid HD+ TFT.<br><br></span><h2><b>Triple camera to capture your live moments</b></h2><span>Galaxy A11\'s Triple camera consists of a 5MP Ultra Wide Camera with a 115-degree field of vision like the human eye, as well as a 13MP (F1.8) camera for bright, clear photos all day. And to round out, a 2MP Depth Camera for adjusting depth of field.<br></span><h2><b><br></b></h2><h2><b>Power that keeps you going</b></h2><span>When out living life, you need a phone that can last. A 4,000mAh (typical)* battery gives you the power to stream, share and game on. And if you start running low, plug in and power up with up to 15W Fast battery Charging.<br><br></span><h2><b>Technical Specifications</b></h2><b><br></b><span><b>DISPLAY</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>Type&nbsp;&nbsp; &nbsp;PLS TFT capacitive touchscreen, 16M colors</li><li>Size&nbsp;&nbsp; &nbsp;6.4 inches, 100.5 cm2 (~81.6% screen-to-body ratio)</li><li>Resolution&nbsp;&nbsp; &nbsp;720 x 1560 pixels, 19.5:9 ratio (~268 ppi density)</li></ul><span><b>PLATFORM</b>&nbsp;&nbsp; &nbsp;<br><br></span><ul><li>OS&nbsp;&nbsp; &nbsp;Android 10</li><li>CPU&nbsp;&nbsp; &nbsp;Octa-core 1.8 GHz</li></ul><span><br><b>MEMORY</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>Card slot&nbsp;&nbsp; &nbsp;microSDXC (dedicated slot)</li><li>Internal&nbsp;&nbsp; &nbsp;32GB + 2GB RAM</li><li>&nbsp;&nbsp;&nbsp; &nbsp;eMMC 5.1</li></ul><span><br><b>MAIN CAMERA&nbsp;&nbsp; </b>&nbsp;<br><br></span><ul><li>Triple&nbsp;&nbsp; &nbsp;<br><ul><li>13 MP, f/1.8, 27mm (wide), AF</li><li>5 MP, f/2.2, 115˚ (ultrawide)</li><li>2 MP, f/2.4, (depth)</li></ul></li><li>Features&nbsp;&nbsp; &nbsp;LED flash, panorama, HDR</li><li>Video&nbsp;&nbsp; &nbsp;1080p@30fps</li></ul><span><b><br>SELFIE CAMERA&nbsp;&nbsp; &nbsp;</b><br></span><ul><li>Single&nbsp;&nbsp; &nbsp;8 MP, f/2.0</li><li>Video&nbsp;&nbsp; &nbsp;1080p@30fps</li></ul><span><b><br>SOUND</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>Loudspeaker&nbsp;</li><li>3.5mm jack&nbsp;</li></ul><span><b><br>COMMS</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>WLAN&nbsp;&nbsp; &nbsp;Wi-Fi 802.11 b/g/n, Wi-Fi Direct, hotspot</li><li>Bluetooth&nbsp;&nbsp; &nbsp;4.2, A2DP, LE</li><li>GPS&nbsp;&nbsp; &nbsp;Yes, with A-GPS, GLONASS, GALILEO, BDS</li><li>Radio&nbsp;&nbsp; &nbsp;Unspecified</li><li>USB&nbsp;&nbsp; &nbsp;2.0, Type-C 1.0 reversible connector</li></ul><span><b><br>FEATURES</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>Sensors&nbsp;&nbsp; &nbsp;Fingerprint (rear-mounted), accelerometer, proximity</li></ul><span><b><br>BATTERY</b>&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;<br></span><ul><li>Non-removable Li-Po 4000 mAh battery</li></ul>', 'samsung-galaxy-a11-64-32gb-2gb-ram-dual-sim-4000mah001.jpg', NULL, 'samsung-galaxy-a11-64-32gb-2gb-ram-dual-sim-4000mah-002.jpg', 'samsung-galaxy-a11-64-32gb-2gb-ram-dual-sim-4000mah-003.jpg', NULL, '2020-10-14 16:03:44', '2020-10-14 16:03:44'),
