(37, 'Tecno Camon 16 Premier, 6.6\'\', 8GB +128GB,64MP+48MP Selfie (Dual SIM)', 'tecno-camon-16-premier-66-8gb-128gb64mp48mp-selfie-dual-sim', NULL, 0, 'In Stock', 'Tecno Camon 16 Premier, 6.6\'\', 8GB +128GB,64MP+48MP Selfie (Dual SIM)', '29800', 500, '4', NULL, 0, 0, 0, 0, 3, 'New', 'TECNO-C16-PR', 'Tecno', '0', '<span>The Tecno Camon 16 Premier is the direct successor to the Camon 15 Premier launched about 6-months ago. The new Camon 16 Premier combines the power of the Mediatek Helio G90T CPU with a total of six (6) camera setups. The device spot a 6.78-inches FHD+ display featuring pill-notch and 90Hz refresh rate.<br><br></span>Talking about the camera, the device has a dual 40MP + 8MP selfie snappers, kept in the pill-notch upfront. As for the rear camera setup, the Camon 16-premier has four modules which include a 64-megapixel main lens, pegged with 8-megapixel ultra-wide lens, a third 5-megapixel macro lens, and a fourth 2-megapixel depth snapper, coupled with a quad-LED flash.<br><span><br>The Mediatek MT6785, also known as Helio G90T SoC seats on the inside with 8-core CPUs split into 2×2.05GHz Cortex-A76, and 6×2.0 GHz Cortex-. As for graphics and gaming, there is the Mali-G76 MC4 GPU, pegged with 8GB RAM and 128GB of built-in storage.<br><br><br></span><h3>Audio, Video Playback</h3><ul><li>Music Support: , AAC / AAC + / eAAC + / MP3 / AMR – / WB / APE</li><li>Audio: 3.5 mm audio jack</li><li>Loudspeaker: Mono speakers</li><li>Video Support: H.264/MP4/MPEG4 player</li><li>FM Radio: Yes.</li></ul><h3><br></h3><h3>Phone Sensors</h3><ul><li>Digital Compass: Yes.</li><li>Accelerometer: Yes.</li><li>Proximity Sensor: Yes.</li><li>Ambient Light Sensor: Yes.</li><li>Barometer: No.</li><li>Pedometer: No.</li><li>Heart Rate Monitor: No.</li><li>Gyroscope (G-Sensor): Yes.</li><li>Fingerprint Scanner: Yes; rear-mounted.</li><li>Face Unlock: Yes.</li><li>Iris Scanner: No.</li><li>Motion Sensing / Gesture Control: No.</li><li>Voice Control: No.</li><li>Intelligent Digital Assistant: Yes; Google Assistant.</li><li>Infra-red Sensor: No.</li></ul><h3><br></h3><h3>Connectivity Options</h3><ul><li>Bluetooth: v5.0, A2DP</li><li>WiFi: Wi-Fi 802.11 a/b/g/n/ac, hotspot</li><li>GPS: Yes, A-GPS, BDS</li><li>USB: microUSB v2.0.</li><li>NFC: No.</li></ul><h3><br></h3><h3>Internal Hardware Specs</h3><ul><li>Processor Type: 64-bit, 2.2 GHz Octa-core,</li><li>Processor Name: Mediatek Helio G90T</li><li>Graphics Processor: ARM Mali-G76 MP4 ( – 800 MHz)</li><li>RAM: 8 GB</li><li>Internal Storage: 128 GB</li><li>External Storage: microSD, up to 512 GB (dedicated slot)</li></ul><h3><br></h3><h3>Photography, Video Recording</h3><ul><li>Rear Quad Camera: 64 MP main sensor + 8MP ultra-wide +&nbsp;2MP&nbsp;depth sensor + 2MP low-light sensor, Quad-LED flash,&nbsp; SLO-MO, 4K and 1080p@30fps video recording</li></ul>', 'tecno-camon-16-premier-66-8gb-128gb64mp48mp-selfie-dual-sim001.jpg', NULL, 'tecno-camon-16-premier-66-8gb-128gb64mp48mp-selfie-dual-sim-002.jpg', 'tecno-camon-16-premier-66-8gb-128gb64mp48mp-selfie-dual-sim-003.jpg', NULL, '2020-10-16 12:15:23', '2020-10-16 12:15:23'),
(38, 'Tecno Camon 15 Air, 6.6\"-3GB RAM*64GB ROM, 48MP, 4G', 'tecno-camon-15-air-66-3gb-ram64gb-rom-48mp-4g', NULL, 0, 'In Stock', 'Tecno Camon 15 Air, 6.6\"-3GB RAM*64GB ROM, 48MP, 4G', '14300', 500, '4', NULL, 0, 0, 0, 0, 3, 'New', 'TECNO-C15-AR', 'Tecno', '0', 'Tecno Camon 15 Air smartphone&nbsp;comes with a 6.6-inch touchscreen display.&nbsp;It comes with&nbsp;3GB of RAM and 64GB&nbsp;<span>of internal storage.&nbsp;Tecno Camon 15 Air runs Android 10 and is powered by a 5000mAh non-removable battery. Tecno Camon 15 Air&nbsp;on the rear packs 48M+2M+2M+AI Lens cameras. The rear camera setup has autofocus. It also sports a 8-megapixel camera on the front for selfies.<br><br></span><h2><br>Technical Specifications</h2><br><span><b>BODY</b>&nbsp;&nbsp;<br>&nbsp;&nbsp;<br></span><ul><li>Dimensions: 164.1 x 76.4 x 8.8 mm (6.46 x 3.01 x 0.35 in)</li><li>Weight: 196 g (6.91 oz)</li><li>Build: Glass front, plastic back, plastic frame</li><li>SIM: Dual SIM (Nano-SIM, dual stand-by)</li></ul><span><br><b>DISPLAY</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>Type: IPS LCD capacitive touchscreen, 16M colors</li><li>Size&nbsp;: 6.6 inches, 105.2 cm2 (~83.9% screen-to-body ratio)</li><li>Resolution: 720 x 1600 pixels, 20:9 ratio (~266 ppi density)</li></ul><span><br><b>PLATFORM</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>OS: Android 10.0; HIOS 6.0</li><li>Chipset: Mediatek MT6762 Helio P22 (12 nm)</li><li>CPU: MT6762 (4*1.8GHz+4*1.5GHz)</li><li>GPU: PowerVR GE8320</li></ul><span><br><b>MEMORY</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>Card slot&nbsp;: microSDXC (dedicated slot)</li><li>Internal: 64GB, 3GB RAM</li><li>&nbsp;&nbsp;&nbsp; &nbsp;eMMC 5.1</li></ul><span><br><b>MAIN CAMERA</b><br></span><ul><li>Quad&nbsp;&nbsp; &nbsp;<br><ul><li>48 MP, PDAF</li><li>2 MP</li><li>2 MP</li><li>AI Lens</li></ul></li><li>Features: Quad-LED flash, panorama, HDR</li><li>Video: 1080p@30fps</li></ul><span><br><b>SELFIE CAMERA&nbsp;&nbsp; </b>&nbsp;<br></span><ul><li>Single: 8MP</li><li>Video: 1080p@30fps</li></ul><span><br><b>SOUND</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>Loudspeaker&nbsp;</li><li>3.5mm jack</li></ul><span><br><b>COMMS</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>WLAN: Wi-Fi 802.11 b/g/n, hotspot</li><li>Bluetooth: 5.0, A2DP, LE</li><li>GPS: Yes, with A-GPS, GLONASS</li><li>Radio: FM radio</li><li>USB: microUSB 2.0, USB On-The-Go</li></ul><span><br><b>FEATURES</b>&nbsp;&nbsp; &nbsp;<br></span><ul><li>Sensors: Fingerprint (rear-mounted), accelerometer, proximity</li></ul><span><br><b>BATTERY</b>&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; &nbsp;<br></span><ul><li>Non-removable Li-Po 5000 mAh batter</li></ul>', 'tecno-camon-15-air-66-3gb-ram64gb-rom-48mp-4g001.jpg', NULL, 'tecno-camon-15-air-66-3gb-ram64gb-rom-48mp-4g-002.jpg', 'tecno-camon-15-air-66-3gb-ram64gb-rom-48mp-4g-003.jpg', NULL, '2020-10-16 12:19:36', '2020-10-16 12:19:36');
